import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function Login(){
    return(
    <div>
    <Router>
     <div>
        <Switch>
          <Route path="/login">
            <Login />
          </Route>
          {/* Add other routes */}
        </Switch>
      </div>
    </Router>


    </div>

    )
}
